import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

interface movie {
  title: string;
  opening_crawl: string;
  release_date: string;
  img?: string;
}

function App() {
  const [movies, setMovies] = useState<any>([]);

  useEffect(() => {
    axios.get("/movies").then((response) => {
      console.log(response.data);
      return setMovies(response.data);
    });
  }, []);

  return (
    <div className="App">
      {movies.map((movie: movie, idx: number) => {
        return (
          <div key={idx} style={{}}>
            <img src={movie.img} style={{ height: 300, objectFit: "cover" }} />
            <h1>{movie.title}</h1>
          </div>
        );
      })}
    </div>
  );
}

export default App;
